var scalePowDots = d3.scalePow().exponent(0.5)
      .domain([115555, 2154092])
      .range([1, 4]);
d3.selectAll('g.cell circle').attr('r', function(d){return scalePowDots(+d.population_insee)*manualReusableParameters.beeswarnRadius.value});
d3.selectAll('g.cell circle').attr('fill', function(d){return ['75', '77','78', '91','92', '93', '94', '95'].includes(d.departement_residence) ? '#E60004' : '#aaa'});
d3.selectAll('g.cell circle').attr('stroke', function(d){return ['75', '77','78', '91','92', '93', '94', '95'].includes(d.departement_residence) ? '#E60004' : '#aaa'});
d3.selectAll('.axis--y .tick text').text(function(d){return d + '%'});
